import Card from "../components/card";
import { motion } from "framer-motion";
const cardInfo = {
  name: "Alvison Hunter",
  title: "Welcome to Mister Excel Nicaragua!",
  imgsrc: "/ahunter_rounded.png",
  imgalt: "Alvison Hunter Arnuero",
  strbody: "Feel free to contact me to get more information.",
  btncaption: "Contact me",
};
const Index = () => (
  <div className="container h-100">
    <div className="row h-100 justify-content-center align-items-center">
      <div className="d-flex justify-content-center vertical-center">
        {" "}
        <motion.Card
          cardInfo={cardInfo}
          className="d-flex justify-content-center vertical-center"
          whileHover={{
            position: "relative",
            zIndex: 1,
            background: "white",
            scale: [1, 1.4, 1.2],
            rotate: [0, 10, -10, 0],
            transition: {
              duration: 2,
            },
          }}
         >

        </motion.Card>
      </div>
    </div>
  </div>
);

export default Index;
